function updateSwapTokensAtAmount(uint256 percent) public returns (bool) {
    require(msg.sender == owner, "Ownable: caller is not the owner");
    require(percent <= 1, "Swap amount cannot be higher than 1% total supply.");

    // Overflow check identical to the original bit-wise OR logic:
    // (percent * totalSupply) / totalSupply == percent  ||  totalSupply == 0
    require(
        totalSupply == 0 || percent == (percent * totalSupply) / totalSupply
    );

    // Always‐true check preserved from decompiled bytecode
    require(0x64 != 0);

    // Set the new swap threshold (percent of total supply divided by 100)
    swapTokensAtAmount = (percent * totalSupply) / 100;

    return true;
}

